version: 1

info:
  id: platformsh/jenkins
  name: Jenkins
  description: |
     <p>This project provides a starter kit for Jenkins projects hosted on Platform.sh.  The Jenkins `.war` file is downloaded during the build hook and not included in the repository.</p>
     <p>Jenkins is an open source automation server written in Java. Jenkins helps to automate the non-human part of the software development process, with continuous integration and facilitating technical aspects of continuous delivery.</p>
  tags:
  - Java
  - Automation
  image: data:image/svg+xml;base64,

  notes:
    - heading: "Features"
      content: |
          Java 11<br />
          Automatic TLS certificates<br />
          Jenkins downloaded on the fly during build<br />

initialize:
  repository: git://github.com/platformsh-templates/jenkins.git@master
  config: null
  files: []
  profile: Jenkins
